import React from 'react';

import './styles.css';

const FlightDisplay = props => {
  return (
    <>
      <div className='flight-display-wrapper'>
        <div className='flight-display-header'>
          {props.airline} {props.flightNumber}
        </div>
      </div>
    </>
  );
};

export default FlightDisplay;
